import React, {Component} from 'react';
import {LoginWrapper} from "../styled/Login.styled";

class Login extends Component {
    render() {
        return (
            <LoginWrapper>
                <div style={{background: "#365DB6"}}></div>
                <div style={{background: "green"}}></div>
            </LoginWrapper>
        );
    }
}

export default Login;
